package ml.pevgen.algo.leetcode.n859;

import org.junit.jupiter.api.BeforeEach;
import org.junit.jupiter.api.Test;

import static org.junit.jupiter.api.Assertions.assertFalse;
import static org.junit.jupiter.api.Assertions.assertTrue;

class BuddyStringsTest {

    private BuddyStrings solution;

    @BeforeEach
    void setUp() {
        solution = new BuddyStrings();
    }

    @Test
    void should_return_false_for_illegal_parameters() {
        assertFalse(solution.buddyStrings(null, null));
        assertFalse(solution.buddyStrings(null, "ab"));
        assertFalse(solution.buddyStrings("ab", null));
        assertFalse(solution.buddyStrings("", ""));
        assertFalse(solution.buddyStrings("a", "ab"));
        assertFalse(solution.buddyStrings("ab", "a"));
    }

    @Test
    void should_return_false_example_1() {
        assertFalse(solution.buddyStrings("ab", "ab"));
    }

    @Test
    void should_return_false_example_2() {
        assertFalse(solution.buddyStrings("abac", "abad"));
    }

    @Test
    void should_return_true_example_1() {
        assertTrue(solution.buddyStrings("ab", "ba"));
    }

    @Test
    void should_return_true_example_2() {
        assertTrue(solution.buddyStrings("aa", "aa"));
    }

    @Test
    void should_return_true_example_3() {
        assertTrue(solution.buddyStrings("abcd", "cbad"));
    }

    @Test
    void should_return_true_example_5() {
        String s1 = "";
        String s2 = "";
        assertTrue(solution.buddyStrings(s1, s2));
    }

}